import React from "react";

class WeatherCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            temperature : null,
            cloudCover : null,
            humidity : null,
            precipitation : null,
            uvIndex : null,
            visibility : null,
            weatherCode: null,
            weatherDescription: null
        }

        this.updateCard = this.updateCard.bind(this);
    }

    updateCard = (currData) => {
        this.setState({
            temperature : currData["temp_F"],
            cloudCover : currData["cloudcover"],
            humidity : currData["humidity"],
            precipitation : currData["precipInches"],
            uvIndex : currData["uvIndex"],
            visibility : currData["visibilityMiles"],
            weatherCode: currData["weatherCode"],
            weatherDescription: currData["weatherDesc"]["value"]
        });
    }

    render() {
        return (
            <div className="WeatherCard">
                <h3>City</h3>
            </div>
        );
    }
}

export default WeatherCard;
